import React from 'react'

function AddCard() {
  return (
    <div style={{padding:'10px',
                 margin:'10px'}}>
      <img src="static/plus.svg" alt="" style={{width:'150px',backgroundColor:'#d3d4d5'}}/>
    </div>
  )
}

export default AddCard
